By using this device, YOU AGREE to the following policy Acceptable Use Policy.

Access to the Prisoner Interactive Learning System is a privilege.

Abuse may result in temporary or permanent loss of use.
Abuse includes, but is not limited to, attempts to
 • disclose your password to another user;
 • grant another user access to your account;
 • access another user's account;
 • communicate with another inmate;
 • use unauthorised media (inc. CD, DVD & USB);
 • install or modify software; and
 • modify system settings.

All use, including email correspondence, may be
 • archived indefinitely;
 • reviewed by automated systems;
 • reviewed by staff;
 • reviewed by external agencies for the purposes of
 • investigating suspected criminal/unlawful activity.

All logs, records and archives may be used as evidence in court.
